import { buildSchema } from 'graphql';
export var schema = buildSchema("\n  type signUpType {\n    userId: String,\n    name: String,\n    message: String,\n    password: String,\n    email: String,\n  }\n  input signUpInput {\n    name: String, \n    password: String, \n    email: String,\n    userId: String,\n  }\n  type signInType {\n    message: String,\n    userId: String,\n    userName: String,\n    password: String,\n  }\n  input signInInput {\n    name: String, \n    password: String, \n    email: String\n  }\n  type Query {\n    signout: String\n    check: String\n  }\n  type Mutation {\n    signUp(input: signUpInput): signUpType\n    signIn(input: signInInput ): signInType\n  }\n");
